import { About,Footer,Header,Skills,Testimonial,Work } from './container';
import { NavBar } from './components';
import './App.scss';
<h1>App</h1>
const App = () => {
    return (

        <div className = "App">
            <NavBar/>
            <About/>
            <Work/>
            <Skills/>
            <Testimonial/>
            <Footer/>



        </div>

    );
}

export default App;
